import React, { Component } from 'react';
import './studentHome'
class studentHome extends Component {
  render() {
    return (
      <div id="my-main">
        <div className="box-my">
        <div className="select-my">我要选题</div>
        <div className="project-my">我的毕设</div>
        <div className="repeat-my">论文查重</div>
        </div>
      </div>
    )
  }
}
export default studentHome;
